import React, { useEffect } from 'react';

const MyComponent = () => {
  const fetchData = async () => {
    const url = 'https://imdb8.p.rapidapi.com/auto-complete?q=game';
    const options = {
      method: 'GET',
      headers: {
        'X-RapidAPI-Key': '189773483emshdf5c2b3eaeea748p1e6fe0jsnaf1dd42e45d5',
        'X-RapidAPI-Host': 'imdb8.p.rapidapi.com'
      }
    };

    try {
      const response = await fetch(url, options);
      const result = await response.text();
      console.log(result);
      // Handle the result as needed (e.g., update state, display data, etc.)
    } catch (error) {
      console.error(error);
      // Handle errors as needed
    }
  };

  useEffect(() => {
    fetchData();
    // Add any dependencies if necessary
  }, []); // Empty dependency array ensures useEffect runs once on component mount

  return (
    <div>
      {/* Your component JSX goes here */}
    </div>
  );
};

export default MyComponent;
